import React, {Component} from "react"
import s from "./Register.module.css"
import RegisterReducer from "../../redux/RegisterReducer";


const Register = (props) =>
{
    let username_change = (e) => {
        RegisterReducer(props.state, 'UPDATE_USERNAME_TEXT');
    }

    let password_change = (e) => {
        state.password = e.target.value; //setState({password: e.target.value});
    }

    let add_post = () => {
        alert(this.state.username + this.state.password);
    }

        return (
        <div className={s.Register}>
            <div className={s.item}>
                Username: <input name="FirstName" onChange={username_change}/>
            </div>
            <div className={s.item}>
                Password: <input value={state.password} name="FirstName" onChange={password_change}/>
            </div>
            <div>
                <button onClick={add_post}> Click </button>
            </div>
        </div>
        )

}

export default Register;
